import { Routes, Route, Navigate } from "react-router-dom";
import { useEffect, useState, useContext } from "react";
import axios from "axios";
import Home from "./routes/Home";
import OrderDetails from "./components/OrderDetails";
import AllOrder from "./routes/AllOrder";
import Administration from "./routes/Administration";
import Signup from "./routes/Signup";
import Login from "./routes/Login";
import SignupUser from "./components-two/SignupUser";
import Test from "./components/Test";
import { AuthContext, AuthProvider } from "./account.service";

function App() {
  const { isAuthenticated } = useContext(AuthContext);

  return (
    <div className="App">
        <Routes>
          <Route
            path="/signup/user"
            element={isAuthenticated ? <Navigate to="/" /> : <SignupUser />}
          />
          <Route
            path="/login"
            element={isAuthenticated ? <Navigate to="/" /> : <Login />}
          />
          <Route
            path="/signup/admin"
            element={isAuthenticated ? <Navigate to="/" /> : <Signup />}
          />
          <Route path="/" element={<Home />} />
          <Route path="/user/file/:id" element={<Test />} />
          <Route path="/dashboard/admin/all-order" element={<AllOrder />} />
          <Route
            path="/dashboard/admin/order/details/:id"
            element={<OrderDetails />}
          />
          <Route
            path="/dashboard/admin/order-administration"
            element={
              isAuthenticated ? (
                <Administration />
              ) : (
                <Navigate to="/login" />
              )
            }
          />
        </Routes>
    </div>
  );
}

function WrappedApp() {
  return (
    <AuthProvider>
      <App />
    </AuthProvider>
  );
}

export default WrappedApp;
